/*
 *-----------------------------------------------------------------------------
 *
 * FUNCTION: local_CompareEESymbolicConstant
 *
 *-----------------------------------------------------------------------------
 */
static int
local_CompareEESymbolicConstant
(
    const EDCS_Enumerant_Label_Entry *a_ptr,
    const EDCS_Enumerant_Label_Entry *b_ptr
)
{
    int result = 0;

    if (!a_ptr && b_ptr)
        return -1;
    else if (!a_ptr && !b_ptr)
        return 0;
    else if (a_ptr && !b_ptr)
        return 1;

    result = edcs_strcmp
             (a_ptr->ee_symbolic_constant, b_ptr->ee_symbolic_constant);

    return result;
} /* end local_CompareEESymbolicConstant */


/*
 *-----------------------------------------------------------------------------
 *
 * FUNCTION: EDCS_GetEEDictionaryEntry
 *
 *-----------------------------------------------------------------------------
 */
EDCS_Status_Code
EDCS_GetEEDictionaryEntry
(
          EDCS_Attribute_Code               ea_code_in,
          EDCS_Enumerant_Code               ee_code_in,
    const EDCS_Enumerant_Dictionary_Entry **result_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;
    const EDCS_Attribute_Dictionary_Entry * ea_dict_entry;

    if (result_out_ptr == NULL)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (!EDCS_ValidEnumerantCode(ea_code_in, ee_code_in))
    {
        status = EDCS_SC_INVALID_INPUT_CODE;
    }
    else if (EDCS_GetEADictionaryEntry(ea_code_in, &ea_dict_entry) !=
             EDCS_SC_SUCCESS)
    {
        /* this really can't fail if ValidEnumerantCode
         * returns true so return failure.
         */
        status = EDCS_SC_OTHER_FAILURE;
    }
    else
    {
        *result_out_ptr = &(ea_dict_entry->ee_list[ee_code_in-1]);
    }
    return status;
} /* end EDCS_GetEEDictionaryEntry */


/*
 *-----------------------------------------------------------------------------
 *
 * FUNCTION: EDCS_LabelToEECode
 *
 *-----------------------------------------------------------------------------
 */
EDCS_Status_Code
EDCS_LabelToEECode
(
    const EDCS_Character       *ea_label_in,
    const EDCS_Character       *ee_label_in,
          EDCS_Attribute_Code  *ea_code_out_ptr,
          EDCS_Enumerant_Code  *ee_code_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;
    EDCS_Attribute_Code ea_code;
    const EDCS_Attribute_Dictionary_Entry * ea_dict_entry;
    EDCS_Count i;

    if (!ea_label_in || !ee_label_in || !ea_code_out_ptr || !ee_code_out_ptr)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else if (((status = EDCS_LabelToEACode(ea_label_in, &ea_code))
             == EDCS_SC_SUCCESS) &&
            ((status = EDCS_GetEADictionaryEntry( ea_code, &ea_dict_entry))
             == EDCS_SC_SUCCESS))
    {
        for( i = 0; i < ea_dict_entry->ee_count; i++ )
        {
            if (!edcs_strcmp( ea_dict_entry->ee_list[i].label, ee_label_in ))
            {
                *ea_code_out_ptr = ea_code;
                *ee_code_out_ptr = ea_dict_entry->ee_list[i].ee_code;
                break;
            }
        }

        if( i == ea_dict_entry->ee_count )
        {
            status = EDCS_SC_INVALID_INPUT_LABEL;
        }
    }
    return status;
} /* end EDCS_LabelToEECode */


/*
 *-----------------------------------------------------------------------------
 *
 * FUNCTION: EDCS_PrintEnumerantCode
 *
 *-----------------------------------------------------------------------------
 */
const char *
EDCS_PrintEnumerantCode
(
     EDCS_Attribute_Code ea_code_in,
     EDCS_Enumerant_Code ee_code_in
)
{
    static char buffer[256];
    const EDCS_Enumerant_Dictionary_Entry * ee_dict_entry;

    if (!EDCS_ValidAttributeCode(ea_code_in))
    {
        sprintf(buffer, "ERROR - ILLEGAL EDCS_Attribute_Code VALUE (%i)",
               (int) ea_code_in);
        return buffer;
    }
    if (!EDCS_ValidEnumerantCode(ea_code_in, ee_code_in))
    {
        sprintf(buffer, "ERROR - ILLEGAL EDCS_Enumerant_Code VALUE (%i)",
               (int) ee_code_in );
        return buffer;
    }
    else if (EDCS_GetEEDictionaryEntry( ea_code_in, ee_code_in,
             &ee_dict_entry) != EDCS_SC_SUCCESS)
    {
        sprintf(buffer, "ERROR - Unknown failure for "\
                "EDCS_Attribute_Code VALUE (%i) + "\
                "EDCS_Enumerant_Code VALUE (%i)",
               (int) ea_code_in, (int) ee_code_in );
        return buffer;
    }
    else
    {
        return ee_dict_entry->symbolic_constant;
    }
} /* end EDCS_PrintEnumerantCode */


/*
 *-----------------------------------------------------------------------------
 *
 * FUNCTION: EDCS_SymbolicConstantToEECode
 *
 *-----------------------------------------------------------------------------
 */
EDCS_Status_Code
EDCS_SymbolicConstantToEECode
(
    const EDCS_Character      *symbolic_constant_in,
          EDCS_Attribute_Code *ea_code_out_ptr,
          EDCS_Enumerant_Code *ee_code_out_ptr
)
{
    EDCS_Status_Code status = EDCS_SC_SUCCESS;
    EDCS_Enumerant_Label_Entry *search_result_ptr = NULL, target;

    if (!symbolic_constant_in || !ea_code_out_ptr || !ee_code_out_ptr)
    {
        status = EDCS_SC_NULL_REQUIRED_PARAMETER;
    }
    else
    {
       *ea_code_out_ptr               = (EDCS_Attribute_Code)0;
       *ee_code_out_ptr               = (EDCS_Enumerant_Code)0;
        target.ee_symbolic_constant   = symbolic_constant_in;

        search_result_ptr = (EDCS_Enumerant_Label_Entry *)
                            bsearch
                            (
                               &target,
                               EDCS_Enumerant_Labels,
                               EDCS_TOTAL_EE,
                               sizeof(EDCS_Enumerant_Label_Entry),
                               (int(*)(const void*,const void *))
                               local_CompareEESymbolicConstant
                            );

        if (search_result_ptr)
        {
            *ea_code_out_ptr = search_result_ptr->ea_code;
            *ee_code_out_ptr = search_result_ptr->ee_code;
        }
        else
        {
            status = EDCS_SC_INVALID_INPUT_SYMBOLIC_CONSTANT;
        }
    }
    return status;
} /* end EDCS_SymbolicConstantToEECode */


/*
 *-----------------------------------------------------------------------------
 *
 * FUNCTION: EDCS_ValidEnumerantCode
 *
 *-----------------------------------------------------------------------------
 */
EDCS_Boolean
EDCS_ValidEnumerantCode
(
    EDCS_Attribute_Code ea_code_in,
    EDCS_Enumerant_Code ee_code_in
)
{
    const EDCS_Attribute_Dictionary_Entry * ea_dict_entry;

    if ((!EDCS_ValidAttributeCode(ea_code_in)) ||
        (EDCS_GetEADictionaryEntry(ea_code_in, &ea_dict_entry) !=
        EDCS_SC_SUCCESS))
    {
        return EDCS_FALSE;
    }
    else
    {
        if ((ea_dict_entry->ee_count == 0) ||
           (ee_code_in < 1) ||
           (ee_code_in > (EDCS_Enumerant_Code) ea_dict_entry->ee_count))
        {
            return EDCS_FALSE;
        }
        else if ((ea_dict_entry->ee_list[ee_code_in-1].ee_code != ee_code_in) &&
                (ea_dict_entry->ee_list[ee_code_in-1].ea_code != ea_code_in))
        {
            return EDCS_FALSE;
        }
        else
        {
            return EDCS_TRUE;
        }
    }
} /* end EDCS_ValidEnumerantCode */
